INSERT INTO wvf_events VALUES("1202","Rund Um","2","15","Der Start erfolgt auf einer etwa 2.700 Meter langen Startlinie vor Lindau. Diese Linie ist an den Auenseiten durch Bojen sowie innen durch Peilstbe auf dem Startschiff begrenzt. Die Linie selbst ist durch das Startschiff (2010: Lindau, 2015: Hohentwiel) geteilt. Auf einem etwa 400 Meter langen Teil der Linie starten die High-Performance-Schiffe, auf dem greren Teil die restlichen teilnehmenden Boote. Danach mssen auf der mindestens 100 Kilometer langen Strecke fr den sogenannten ?Groen Kurs? die Bahnmarken vor Romanshorn, Eichhorn vor Konstanz, berlingen und Meersburg passiert werden. Beim ?Kleinen Kurs? entfllt die Marke in berlingen. Das Ziel ist erneut vor Lindau.<br /><a class=\"link\" href=\"http://www.lsc.de\" target=\"_blank\">http://www.lsc.de</a> ","","2","Administrator ","0","2016-06-03","2016-06-04","","00:00:00","23:59:00","0","0","0","9999-00-00","-1","admin_Buchung@wvfischbach.de","2016-01-19","2016-01-25","0","0","0");
