INSERT INTO wvf_events VALUES("1223","Schoten und Knoten Regatta Arbon","2","15","8. Schoten & Knoten Regatta<br /><br />Die Schoten und Knotenregatta ist ein Mittelstrecken-Race das viel Segelplausch bietet. Der Starschuss erfolgt um 13.00 h zum Gemeinschaftsstart und fhrt ber eine Auslaufboje Richtung Rheinmndung. Das Ziel liegt sdlich von der Einfahrt nach Fussach.<br /><br />Eine Regatta, die immer mehr Teilnehmer anlockt. Die Regatta selbst ist spannend und gesellschaftlich wartet ein tolles Fest im schnen Clubhaus des YC Rheindelta mitten im wunderschnen Naturschutzgebiet auf uns Sportler. Der Hhepunkt bildet allerdings die vom Spitzenkoch aus Feldkirch kstlich zubereitete Paella die schtig macht. Wer sie schon mal geniessen konnte, schwrmt davon. Bekanntlich ist der YC Rheindelta ein exzellenter Gastgeber.<br /><a class=\"link\" href=\"http://www.yca.ch/clubdesk/www?p=1000022\" target=\"_blank\">http://www.yca.ch/clubdesk/www?p=1000022</a> ","","2","Administrator ","0","2016-06-11","9999-00-00","","13:00:00","23:59:00","0","0","0","9999-00-00","-1","admin_Buchung@wvfischbach.de","2016-01-25","2016-01-25","0","0","0");
INSERT INTO wvf_events VALUES("1224","Einhand- Zweihand Rund Um Bregenz","2","15","Startzeit<br />Einhand: Freitag 17.6.2016, 7:00 Uhr. Zweihand: Samstag 18.6.2016, 7:00 Uhr.<br />Regattabahn<br />Start vor Yachthafen YCB, 1. Boje vor Immenstaad, 2. Boje vor Konstanz (Eichhorn), Ziel vor Yachthafen des YCB. Zeitlimit siehe Segelanweisungen. Bei schlechten Windverhltnissen kann die Wettfahrtleitung die Bahn entsprechend abkrzen (siehe Segelanweisung).<br /><a class=\"link\" href=\"http://www.bsc.at\" target=\"_blank\">http://www.bsc.at</a> ","","2","Administrator ","0","2016-06-17","2016-06-18","","00:00:00","23:59:00","0","0","0","9999-00-00","-1","admin_Buchung@wvfischbach.de","2016-01-25","2016-01-25","0","0","0");
